import React from "react";
import SortingVisualizer from "./SortingVisualizer/SortingVisualizer";
import Navbar from "./SortingVisualizer/Navbar";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Navbar id="nav"></Navbar>
      <SortingVisualizer></SortingVisualizer>
    </div>
  );
}

export default App;
